Comment intervenir en cas de blessure aux yeux? En cas de brûlure? Que faire si un collègue a un malaise? Ou lors d’un arrêt cardiorespiratoire? Cette application mobile répond à toutes ces questions. Elle vise aussi à soutenir les secouristes dans leurs interventions en cas de problèmes médicaux (malaise) et traumatiques (accident) sur les lieux de travail. 
L’application mobile Secourisme en milieu de travail s’adresse notamment à tous les secouristes ayant été formés selon les exigences de la CNESST et désirant avoir à portée de main les protocoles d’intervention en situation de travail lors d’urgence, d’accident ou d’incident. 
Détails et contenus de l’application 
•	Trois modes de consultation intuitifs;
o	Accompagnement pas-à-pas lors de vos interventions,
o	Consultation des protocoles en un coup d’œil,
o	Recherche par mots clés.
•	Un design épuré qui permet une navigation simplifiée;
•	Protocoles prenant en compte le système préhospitalier d’urgence du Québec; 
•	Bottin téléphonique d’urgence (sur les téléphones uniquement);
•	Présentation de l’approche de L’ABC pour évaluer la situation.

Cette application présente le contenu du Guide du secouriste en milieu de travail remis lors de la formation. Vous y trouverez de l’information en matière de secourisme conforme aux normes en vigueur.
